import React from 'react';
import '../scss/components/user-page.scss'

const UserPage = () => {
    return (
        <div className='user-page'>
            <div className='user-information'></div>
            <div className='title'>
                <h1>Tell <span>me</span></h1>
            </div>
        </div>
    )
}

export default UserPage;
